import React from 'react';
import Header from './Header';
import Nav from './Nav';
import Footer from  './Footer';
import styles from './main.module.css'

function HomeTwice() {
  return (
    <div id='wrap'>
      <div className={styles.container}>
        <div className={styles.mainBgImg}></div>
      </div>
      <Header></Header>
      <Nav></Nav>

      <Footer></Footer>
    </div>
  );
}

export default HomeTwice;
